import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import StudentTable from './StudentTable';
import CreateStudent from './CreateStudent';
import EditStudent from './EditStudent';
import ViewStudent from './ViewStudent';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<StudentTable />}></Route>
        <Route path="/student/create_student" element={<CreateStudent />}></Route>
        <Route path="/student/edit_student/:id" element={<EditStudent />}></Route>
        <Route path="/student/view_student/:id" element={<ViewStudent />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
